changeSet.createView:
CREATE OR REPLACE FORCE VIEW V_TL_W_BOOKED_CTRY_ORDER (BOOKING_REF, NAME, RESORT, NIGHTS, ROOM_TYPE, ACCOM_KEY, COUNTRY, HCODE, REGION, MAIN_HOTEL_NAME, MASTER_HOTEL_NAME, START_DATE, END_DATE, PAX_EXC_INFANTS, RATING, BOARD_BASIS, ACCOM_ORDER) AS SELECT accom.booking_ref, accom.NAME,resort,nights,room_type, accom.accom_key, country,hcode,region, main_hotel_name, Master_hotel_name, start_date,end_date,pax_exc_infants, rating,board_basis ,row_number() over ( PARTITION BY accom.booking_ref ORDER BY start_date) AS accom_order
FROM ( SELECT a.booking_ref, a.NAME,MIN(a.booked_accom_key) accom_key, rating,a.hcode, a.start_date, a.end_date,a.resort, r.region,nights,NVL(h.master_hotel_name,a.name) as MASTER_HOTEL_NAME, NVL(h.main_hotel_name,a.name) as MAIN_HOTEL_NAME,a.room_type,-- add room type here and into group by --removed SUM from around adults and children - added them to group by (num_children + Num_adults) PAX_EXC_INFANTS,nvl(r.country,'N/A')country,a.board_basis FROM tlinkw.tl_w_bookedaccommodation a , tlinkw.hotel_name_dim h, (select * from tlinkw.tl_w_resortregioncountryview rcv where amendment_order = ( select min(amendment_order) from tlinkw.tl_w_resortregioncountryview x where rcv.resort = x.resort)) r WHERE a.amendment_order = 0 and h.tl_hotel_name (+) = a.name and upper(a.resort) = Upper(r.resort(+))
/*AND EXISTS ( SELECT null FROM tl_w_bookings x WHERE a.booking_ref = x.booking_ref AND x.confirm_date IS NOT NULL AND x.amendment_order = 0)*/ --AND num_children + Num_adults > 0 GROUP BY a.booking_ref, a.NAME,a.start_date, a.end_date, a.resort,r.region,nights,rating,a.hcode,nvl(r.country,'N/A'), NVL(h.master_hotel_name,a.name) , NVL(h.main_hotel_name,a.name),room_type,num_children , Num_adults,a.board_basis ORDER BY 1, 3 ) ACCOM

CREATE OR REPLACE FORCE VIEW ZZZ_VIEW (BOOKING_REF, LEAD_NAME, CLIENT_REF, BOOKING_STATUS, OPTION_DATE, DEPARTURE_DATE, BALANCE_DUE_DATE, CURRENCY, TOTAL_REVENUE, COMMISSION, VAT_ON_COMMISSION, TOTAL_RECEIVED, ADJUSTMENT, VAT_ON_SALES, TOTAL_COSTS, BALANCE_DUE, ADULTS, CHILDREN, INFANTS, PRODUCT, PRODUCT_CODE, BOOKED_BY, CONFIRM_DATE, DURATION, CANCELLATION_DATE, BOOKING_SOURCE, AMENDMENT_DATE, AMENDMENT_ORDER, PROCESS_DATE, PROCESS_RECORD_ID) AS (select "BOOKING_REF","LEAD_NAME","CLIENT_REF","BOOKING_STATUS","OPTION_DATE","DEPARTURE_DATE","BALANCE_DUE_DATE","CURRENCY","TOTAL_REVENUE","COMMISSION","VAT_ON_COMMISSION","TOTAL_RECEIVED","ADJUSTMENT","VAT_ON_SALES","TOTAL_COSTS","BALANCE_DUE","ADULTS","CHILDREN","INFANTS","PRODUCT","PRODUCT_CODE","BOOKED_BY","CONFIRM_DATE","DURATION","CANCELLATION_DATE","BOOKING_SOURCE","AMENDMENT_DATE","AMENDMENT_ORDER","PROCESS_DATE","PROCESS_RECORD_ID" from 
TL_W_BOOKINGS 
)
